INSERT INTO `product` VALUES (1,'The Iconic Mesh Polo Shirt','<div><span style=\"\">An American style standard since 1972, the Polo shirt has been imitated but never matched. Over the decades, Ralph Lauren has reimagined his signature style in a wide array of colors and fits, yet all retain the quality and attention to detail of the iconic original. This relaxed version is made from our highly breathable cotton mesh, which offers a textured look and a soft feel.</span><br></div><div><div><div><ul style=\"box-sizing: inherit; list-style-position: initial; list-style-image: initial; margin: 0px 0px 0px 0.9375rem; padding: 0px; column-count: 2;\"><li style=\"box-sizing: inherit; list-style: disc; margin: 0px 20px; line-height: 26px;\">Classic Fit: our roomiest silhouette. Cut for a lower armhole and a fuller sleeve that falls closer to the elbow.</li></ul><ul style=\"box-sizing: inherit; list-style-position: initial; list-style-image: initial; margin: 0px 0px 0px 0.9375rem; padding: 0px; column-count: 2;\"><li style=\"box-sizing: inherit; list-style: disc; margin: 0px 20px; line-height: 26px;\">Ribbed Polo collar. Two-button placket.</li></ul><ul style=\"box-sizing: inherit; list-style-position: initial; list-style-image: initial; margin: 0px 0px 0px 0.9375rem; padding: 0px; column-count: 2;\"><li style=\"box-sizing: inherit; list-style: disc; margin: 0px 20px; line-height: 26px;\">Short sleeves with ribbed armbands.</li></ul><ul style=\"box-sizing: inherit; list-style-position: initial; list-style-image: initial; margin: 0px 0px 0px 0.9375rem; padding: 0px; column-count: 2;\"><li style=\"box-sizing: inherit; list-style: disc; margin: 0px 20px; line-height: 26px;\">Tennis tail.</li></ul><ul style=\"box-sizing: inherit; list-style-position: initial; list-style-image: initial; margin: 0px 0px 0px 0.9375rem; padding: 0px; column-count: 2;\"><li style=\"box-sizing: inherit; list-style: disc; margin: 0px 20px; line-height: 26px;\">Signature embroidered Pony at the left ches