DROP TABLE IF EXISTS `product_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `product_order` (
  `order_id` int NOT NULL AUTO_INCREMENT,
  `customer_id` int NOT NULL,
  `order_date` datetime NOT NULL,
  `recipient_address_line1` varchar(128) NOT NULL,
  `recipient_address_line2` varchar(128) NOT NULL,
  `recipient_first_name` varchar(32) NOT NULL,
  `recipient_last_name` varchar(32) NOT NULL,
  `recipient_phone` varchar(16) NOT NULL,
  `recipient_country` varchar(2) NOT NULL,
  `recipient_state` varchar(32) NOT NULL,
  `recipient_city` varchar(32) NOT NULL,
  `recipient_zip_code` varchar(16) NOT NULL,
  `payment_method` varchar(32) NOT NULL,
  `shipping_fee` float NOT NULL,
  `tax` float NOT NULL,
  `subtotal` float NOT NULL,
  `total` float NOT NULL,
  `status` varchar(32) NOT NULL,
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_id_UNIQUE` (`order_id`),
  KEY `customer_fk_2_idx` (`customer_id`),
  CONSTRAINT `customer_fk_2` FOREIGN KEY (`customer_id`) REFERENCES `customer` (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb3;
